class NamePlate extends React.Component{
    render(){
        return (
            <div name="Bio">
                <h1>Ben Lottes</h1>
                <p>
                    <a href="https://github.com/benlottes" target="_blank" rel="noreferrer noopener">My github</a>
                    <p>benclottes@gmail.com</p>
                </p>
            </div>
        )
    }
}

export default NamePlate
